WebAssembly.instantiate(getBinaryCodeChromaticSoftHarp(), faust.importObject)
            .then(dsp_module => {
                  faust.ChromaticSoftHarp_instance = dsp_module.instance;
                  registerProcessor('ChromaticSoftHarp', ChromaticSoftHarpProcessor);
            })
            .catch(function() { console.log("Faust ChromaticSoftHarp cannot be loaded or compiled"); });


